        function openPDF() {
            var byteCharacters = atob(this.base64PDF);
            var byteArrays = [];
            for (var offset = 0; offset < byteCharacters.length; offset += 512) {
                var slice = byteCharacters.slice(offset, offset + 512);

                var byteNumbers = new Array(slice.length);
                for (var i = 0; i < slice.length; i++) {
                    byteNumbers[i] = slice.charCodeAt(i);
                }

                var byteArray = new Uint8Array(byteNumbers);
                byteArrays.push(byteArray);
            }
            var blob = new Blob(byteArrays, { type: 'application/pdf' });

            // Abre o documento PDF em uma nova janela ou aba do navegador
            var url = window.URL.createObjectURL(blob);
            window.open(url, '_blank');
        }

        function downloadPDF() {
            var byteCharacters = atob(this.base64PDF);
            var byteArrays = new Array(byteCharacters.length);
            for (var i = 0; i < byteCharacters.length; i++) {
                byteArrays[i] = byteCharacters.charCodeAt(i);
            }
            var byteArray = new Uint8Array(byteArrays);
            var blob = new Blob([byteArray], { type: 'application/pdf' });
            var url = window.URL.createObjectURL(blob);

            var a = document.createElement('a');
            a.href = url;
            a.download = 'top10PDFS.pdf';
            a.style.display = 'none';
            document.body.appendChild(a);
            a.click();
            document.body.removeChild(a);
        }
    </script>
